import React, { useEffect } from "react";
import * as API from "../../utils/api";

const Index = () => {
  useEffect(() => {
    API.getTodos
      .get("http://localhost:3000/todos")
      .then(function (response) {
        console.log(response);
      })
      .catch(function (error) {
        console.log(error);
      })
      .finally(function () {});
  }, []);
  return <></>;
};

export default Index;
